  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata document describes the collection
  and processing of topographic elevation point data derived from Interferometric
  Synthetic Aperture Radar (IfSAR) measurement for coastal Southern California. Collection
  consists of topographic elevations from the California counties of Santa Barbara,
  Ventura, Los Angeles, Orange, and San Diego, and the hydrologic units within those
  counties that drain to the Pacific Ocean along with offshore islands within the
  Channel Islands. The resulting data available for download, include the Digital
  Elevation Model (DEM), and the Raw magnitude radar reflectance data. Height Variance
  data is available upon request from NOAA OCM. The elevation data is first surface
  return (vegetation is in the dataset) X-band IfSAR with three meter point spacing
  and approximately one meter vertical accuracy in non-vegetated areas. The elevation
  data is available in NAVD88 vertical datum.\",\n\t\"license_title\": null,\n\t\"extras\":
